import React, { Component } from 'react';

function ProductsList() {
 
return (
    <div>
        <table>
            <tbody>
              
                {this.props.products.map(product =>    <ProductDetail name = {props.name} description = {props.description} price = {props.product}></ProductDetail>)}
            </tbody>            
        </table>
    </div>
                )
                }

export default ProductsList;
